import styled from "@emotion/styled";

export default function MainPage() {
  // styles
  const Button = styled.button`
    background: black;
  `;

  const Container = styled.div`
    background: #fff;
    font-size: 150px;
  `;
  return <Container>You now can start working</Container>;
}
